        [color=#1b487e]░██░████░░░██░░░░[/color]      [head=3]   Бланк документа[/head]

        [color=#1b487e]░░█░██░██░░██░█░░[/color]               [head=3]НаноТрейзен[/head]

        [color=#1b487e]░░░░██░░██░██░██░[/color] [bold]      Шаттл "Орвилл"ЦК-НИО[/bold]

        [color=#1b487e]░░░░██░░░████░███[/color]

        =============================================
             [head=3]ЦЕЛЬ ИССЛЕДОВАТЕЛЬСКОГО НАЗНАЧЕНИЯ
                                      ШАТТЛА "ОРВИЛЛ"[/head] 
        =============================================

              Капитану следует внимательно выполнять следующую цель, а так же проинформировать экипаж шаттла.
        Ваша цель - утилизация и последующие изучение обломков шаттла группировки Синдиката, по нашим данным направляющийся к станции Тайпана. Экипажу следует быть бдительным и выполнять постепенную утилизацию, всё вооружение разрешается использовать при стычках с неизвестными угрозами, но с последующей телепортацией по средствам телепадов на СЦК. По возможности следует найти бортовой журнал шаттла с последующей доставкой на станции ЦК. Если конфликта можно избежать, то следует поступить с последующей защитой экипажа.

